import React from "react";

class HornedBeast extends React.Component {
  render() {
    return (
      <>
        <div></div>
        <p>
          The Horned Beasts (pg. 60) When everyone has lain in their beddings in
          the cave and the fire burns low to an ember, the wilderness has a way
          of coming in to the depths of a man’s subconscious, in that place
          where they call the Place of Dreams. In this realm, the strength of
          the men is tested. Their will as hunters are brought to the edge,
          because in this wild the predator becomes the prey, and there is no
          certainty of escape – no certainty of waking. The Horned Beasts – that
          is what they are.
        </p>
        <p></p>
      </>
    );
  }
}
export default HornedBeast;
